import React, { useEffect, useState } from 'react';
import { makeStyles, Typography, ExpansionPanel, ExpansionPanelSummary, ExpansionPanelDetails } from '@material-ui/core';
import axios from 'axios';
import PageTitle from '../../Components/Layout/PageTitle';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
  },
  heading: {
    fontSize: theme.typography.pxToRem(15),
    fontWeight: theme.typography.fontWeightRegular,
  },
  expansionPanalRoot: {
    margin: '0px 10px 0px 10px',
    boxShadow: '0px 0px 3px 0px rgba(0,0,0,0.6)',
  },
}));

const CatalogMinimise = ({showRedirect}) => {
  const classes = useStyles();
  const [catalogItems, setCatalogItems] = useState([]);

  useEffect(() => {
    axios({
      method:'get',
      url: process.env.REACT_APP_API+'/api/inventory'
    }).then(function(inventory){
      setCatalogItems(inventory.data);
    }).catch(function(err){
      console.log(err);
    })
  }, []);

  return (
    <div className={classes.root}>
      <PageTitle title="Catalog" variant="h4" />
      <ExpansionPanel className={classes.expansionPanalRoot}>
        <ExpansionPanelSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography className={classes.heading}>Expansion Panel 1</Typography>
        </ExpansionPanelSummary>
        <ExpansionPanelDetails>
          <Typography>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse malesuada lacus ex,
            sit amet blandit leo lobortis eget.
          </Typography>
        </ExpansionPanelDetails>
      </ExpansionPanel>
    </div>
  )
}

export default CatalogMinimise;
